import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from "react-router-dom";

ReactDOM.render(
  <BrowserRouter>
  <link href="../src/output.css" rel="stylesheet"/>
    <App />
  </BrowserRouter>,
  document.getElementById("root")
);
